import ReactApexChart from 'react-apexcharts';
import Emptable from './employee';

const PieChart = (props) => {
    const options = {
        chart: {
            type: 'pie',

        },
        labels: ['Devlopers', 'Frant-end', 'Testers', 'Others'],
        series: [35, 25, 40, 10], // The data percentages for each slice
    };
    return (
        <div style={{Color: props.mode === 'dark' ? 'white' : 'Black'}}>
            <Emptable style={{Color: props.mode === 'dark' ? 'white' : 'Black'}}/>
            <h3 style={{Color: props.mode === 'dark' ? 'white' : 'Black'}} >Company Employees Salary performance</h3>
            <ReactApexChart options={options} series={options.series} type="pie" width="500" />
        </div>
    );
};export default PieChart;
